import React from "react";
import ReactDOM from "react-dom";
 
const m=9;
let greeting="";
const clr={};

if (m==10){
  greeting="oh its  ok";
  clr.color="green";
}else{
  greeting="its not ok";
  clr.color="red";
}


ReactDOM.render(<h1>the code is {clr}{greeting}</h1> 
,document.getElementById('root'));
